import React, { useEffect, useState } from 'react';
import { searchProperties, getAllProperties, getPropertyEnums } from '../api/propertyService';
import PropertyCard from '../components/PropertyCard';
import "../styles/CatalogPage.css"
const CatalogPage = () => {
    const [properties, setProperties] = useState([]);
    const [propertyTypes, setPropertyTypes] = useState([]);
    const [filters, setFilters] = useState({
        city: '',
        minRooms: '',
        maxRooms: '',
        minPrice: '',
        maxPrice: '',
        propertyType: ''
    });
    const [loading, setLoading] = useState({
        properties: false,
        enums: false
    });
    const [error, setError] = useState(null);

    useEffect(() => {
        const loadInitialData = async () => {
            try {
                setLoading(prev => ({ ...prev, enums: true, properties: true }));

                // Загружаем данные параллельно
                const [enumsResponse, propertiesResponse] = await Promise.all([
                    getPropertyEnums(),
                    getAllProperties()
                ]);

                if (!enumsResponse || !Array.isArray(enumsResponse.propertyTypes)) {
                    throw new Error('Неверный формат данных типов недвижимости');
                }

                if (!propertiesResponse || !Array.isArray(propertiesResponse)) {
                    throw new Error('Неверный формат данных объектов недвижимости');
                }

                setPropertyTypes(enumsResponse.propertyTypes);
                setProperties(propertiesResponse);
            } catch (err) {
                console.error('Ошибка загрузки:', err);
                setError(err.message || 'Ошибка при загрузке данных');
            } finally {
                setLoading(prev => ({ ...prev, enums: false, properties: false }));
            }
        };

        loadInitialData();
    }, []);

    const handleSearch = async () => {
        setLoading(prev => ({ ...prev, properties: true }));
        setError(null);

        try {
            // Фильтруем только заполненные параметры
            const activeFilters = Object.fromEntries(
                Object.entries(filters).filter(([_, value]) => value !== '')
            );

            const result = Object.keys(activeFilters).length > 0
                ? await searchProperties(activeFilters)
                : await getAllProperties();

            if (!result || !Array.isArray(result)) {
                throw new Error('Неверный формат данных');
            }

            setProperties(result);
        } catch (err) {
            console.error('Ошибка поиска:', err);
            setError(err.message || 'Ошибка при поиске объектов');
        } finally {
            setLoading(prev => ({ ...prev, properties: false }));
        }
    };

    const handleChange = (e) => {
        const { name, value } = e.target;
        setFilters(prev => ({ ...prev, [name]: value }));
    };

    const resetFilters = () => {
        setFilters({
            city: '',
            minRooms: '',
            maxRooms: '',
            minPrice: '',
            maxPrice: '',
            propertyType: ''
        });
        handleSearch();
    };

    // Проверка данных перед рендерингом
    const renderProperties = () => {
        if (loading.properties) return <p>Загрузка объектов...</p>;
        if (error) return <p className="error">{error}</p>;
        if (!properties || properties.length === 0) return <p>Объекты не найдены</p>;

        return (
            <div className="property-list">
                {properties.map(property => {
                    if (!property || !property.id) return null;

                    return (
                        <PropertyCard
                            key={property.id}
                            property={property}
                        />
                    );
                })}
            </div>
        );
    };

    return (
        <div className="page-container">
            <h1>Каталог</h1>

            {/* Форма фильтрации */}
            <div className="filter-form">
                <input type="text" name="city" placeholder="Город"
                       value={filters.city} onChange={handleChange} />
                <input type="number" name="minRooms" placeholder="Мин. комнат"
                       value={filters.minRooms} onChange={handleChange} />
                <input type="number" name="maxRooms" placeholder="Макс. комнат"
                       value={filters.maxRooms} onChange={handleChange} />
                <input type="number" name="minPrice" placeholder="Мин. цена"
                       value={filters.minPrice} onChange={handleChange} />
                <input type="number" name="maxPrice" placeholder="Макс. цена"
                       value={filters.maxPrice} onChange={handleChange} />

                <select
                    name="propertyType"
                    value={filters.propertyType}
                    onChange={handleChange}
                    disabled={loading.enums}
                >
                    <option value="">Все типы</option>
                    {propertyTypes.map(type => (
                        <option key={type.value} value={type.value}>
                            {type.label}
                        </option>
                    ))}
                </select>

                <div className="filter-buttons">
                    <button
                        onClick={handleSearch}
                        disabled={loading.properties}
                    >
                        {loading.properties ? 'Поиск...' : 'Поиск'}
                    </button>
                    <button
                        onClick={resetFilters}
                        className="reset-button"
                        disabled={loading.properties}
                    >
                        Сбросить
                    </button>
                </div>
            </div>

            {/* Статус загрузки enum'ов */}
            {loading.enums && <p>Загрузка типов недвижимости...</p>}

            {/* Отображение объектов недвижимости */}
            {renderProperties()}
        </div>
    );
};

export default CatalogPage;
